import{_ as e,o as r,c as a,O as i}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 46.2-746.2:2 Special license plates; members and former members of the 173rd Airborne Brigade.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-746.2:2.md","filePath":"vacode/46.2-746.2:2.md"}'),t={name:"vacode/46.2-746.2:2.md"},s=i('<h1 id="§-46-2-746-2-2-special-license-plates-members-and-former-members-of-the-173rd-airborne-brigade" tabindex="-1">§ 46.2-746.2:2 Special license plates; members and former members of the 173rd Airborne Brigade. <a class="header-anchor" href="#§-46-2-746-2-2-special-license-plates-members-and-former-members-of-the-173rd-airborne-brigade" aria-label="Permalink to &quot;§ 46.2-746.2:2 Special license plates; members and former members of the 173rd Airborne Brigade.&quot;">​</a></h1><p>On receipt of an application therefor and presentation of written evidence that the applicant is a member or former member of the 173rd Airborne Brigade, the Commissioner shall issue to the applicant special license plates.</p><p>The provisions of subdivisions 1 and 2 of subsection B of § <a href="http://law.lis.virginia.gov/vacode/46.2-725/" target="_blank" rel="noreferrer">46.2-725</a> shall not apply to license plates issued under this section.</p><p>No license plates shall be issued under this section unless and until a one-time fee of $3,500 shall have been paid to the Commissioner.</p><p>1999, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0907" target="_blank" rel="noreferrer">907</a>; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0864" target="_blank" rel="noreferrer">864</a>.</p>',5),o=[s];function n(l,c,p,d,m,f){return r(),a("div",null,o)}const b=e(t,[["render",n]]);export{_ as __pageData,b as default};
